import React from 'react';
import Typography from '@material-ui/core/Typography';
import Logo from '../../../../public/cerebral_icon.png';

const About = () => (
    <div style={{textAlign: 'center'}}>
        <img style={{width: '75px', height: '75px', marginBottom: '10px'}} src={Logo} alt = "Cerebral Logo" />
        <Typography variant="h5" paragraph>
            What is Cerebral?
        </Typography>
        <Typography variant="body1">
            Cerebral is an app designed to help you keep track of your emotions and experiences in an organized and \n
            clean way.
        </Typography>
    </div>
)

export default About;
